Descripción corta:
Por sus  ingredientes activos tiene propiedades calmantes, astringentes y regeneradoras, así mejorando el aspecto de la piel grasa, con barros o espinillas.

Ideal para pieles grasas o sensibles.

INGREDIENTES: Extracto de Caléndula, Manzanilla, Áloe Vera, Ortiga y Pepino.

MODO DE USO: Después de limpiar y tonificar la piel, aplicar una cantidad suficiente en la zona del rostro y el cuello, masajear hasta su completar su absorción .

Productos agroecológicos, naturales, no testeados en animales y sin parabenos. Permite que la sabiduría infinita de la naturaleza entre en contacto con tu ser. Lo llevaremos hasta la puerta de tu casa.  ¡Adquiérelo ya!

