Gracias al contenido de ácido kojico y escualeno presentes en el arroz, ayuda a tonificar y a mejorar la elasticidad de la piel.

Por su rico aporte en proteínas ayuda a nutrir, humectar, hidratar y suavizar la piel.

Ideal para pieles jóvenes y secas.

